Common.LongDescription.Common.Text:
Office units 8 & 9 in the recently refurbished 81 Prospect Road complex are simply stunning.  This is the ideal commercial tenancy for businesses looking for top quality space that will impress all who visit it.

The tenancy is afforded with a highly impressive modern fit-out with plenty of glass and comprises reception/waiting, stunning boardroom/meeting room, open plan work areas, offices, kitchen/lunchroom, store and amenities.

Further features include:

- An abundance of natural light;
- Fully air conditioned throughout;
- Security system;
- Quality window treatments;
- Terrific signage opportunities;
- Ample on-site parking.

Other operators in the complex include Cafe Bello, Rocktain Hair and Healthy Inspirations.

This offering is suited to a wide range of commercial office users and professionals who are looking for sheer quality but at an affordable price.

Units 8 & 9 in the recently refurbished and upgraded 81 Prospect Road complex are simply stunning.

This is the ideal commercial tenancy for businesses looking for quality space that will impress staff, and all who visit it.

The premises is afforded with a highly impressive modern fit-out with plenty of glass and comprises reception / waiting, stunning boardroom / meeting room, open plan work areas, offices, kitchen / lunchroom, store and amenities.

Additional features include:

-   An abundance of natural light;
-   Fully air conditioned throughout;
-   Security system;
-   Quality window treatments;
-   Terrific signage opportunities;
-   Ample on-site parking.

Other businesses within the complex include The Upside Cafe, Eatability Feeding Services, Bio Nails & Beauty, and Motivate Kids.

81 Prospect Road is situated on the corner of Labrina Avenue, on the eastern side of Prospect Road, in the sought after “Village Heart”, and is located directly opposite the super impressive and brand new Palace Nova Cinema complex.  It really is a truly superb location to be in. 

This offering would be suited to a wide range of commercial office users, consulting rooms and professionals looking for sheer quality but at an affordable price.
